<!DOCTYPE html>
<html lang="ko" xmlns:th="http://www.thymeleaf.org">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<body>
    <div class="wrap">
        <table border="1">
            <tr th:each="date : ${excelDate}">
                <td>[[${date.A}]]</td>
                <td>[[${date.B}]]</td>
                <td>[[${date.C}]]</td>
                <td>[[${date.D}]]</td>
                <td>[[${date.E}]]</td>
                <td>[[${date.F}]]</td>
                <td>[[${date.G}]]</td>
                <td>[[${date.H}]]</td>
                <td>[[${date.I}]]</td>
                <td>[[${date.J}]]</td>
                <td>[[${date.K}]]</td>
                <td>[[${date.L}]]</td>
                <td>[[${date.M}]]</td>
                <td>[[${date.N}]]</td>
                <td>[[${date.O}]]</td>
                <td>[[${date.P}]]</td>
                <td>[[${date.Q}]]</td>
                <td>[[${date.R}]]</td>
                <td>[[${date.S}]]</td>
                <td>[[${date.T}]]</td>
            </tr>
        </table>
    </div>
</body>
</html>
